import React from 'react';
import './App.css';
import Countdown from './components/Countdown';

const events = require("./countdown-list.json");

function App() {
  let ret = events.map(event => 
    console.log(event));
  return (
    <div className="App">
      <h1>Hello World</h1>
      {events.map(event =>
        <Countdown
          key={event.id}
          title={event.title}
          month={event.month}
          day={event.day}
          year={event.year}
        />
      )}
    </div>
  );
}

export default App;
